import React from 'react';
import { Card, Row } from 'react-bootstrap';
import TeacherCard from './TeacherCard';
import './TeacherCard.css'; // Import the CSS file


const TeacherCardGrid = ({ teachers }) => {
  return (
    <Row className="row-cols-1 row-cols-md-2 g-4 justify-content-center">
      {teachers.map((teacher) => (
        <div key={teacher.PrimaryInstructor} className="card-wrapper">
          <TeacherCard name={teacher.PrimaryInstructor} dep={teacher.DEPTNAME} />
        </div>
      ))}
    </Row>
  );
};

export default TeacherCardGrid;
